//Code for collpasing panels
$(document).on('click', '.card-header .removepanel', function () {
    var $this = $(this);
    $this.parents('.card').hide("slow");
});
//panel hide
$('.showhide').attr('title', 'Hide Panel content');
$(document).on('click', '.card-header .clickable', function (e) {
    var $this = $(this);
    if (!$this.hasClass('collapsed')) {
        $this.parents('.card').find('.card-body').slideUp();
        $this.addClass('collapsed').removeClass('fa-chevron-up').addClass('fa-chevron-down');
        $('.showhide').attr('title', 'Show Panel content');
    } else {
        $this.parents('.card').find('.card-body').slideDown();
        $this.removeClass('collapsed').removeClass('fa-chevron-down').addClass('fa-chevron-up');
        $('.showhide').attr('title', 'Hide Panel content');
    }
});

//leftmenu init
$(function () {
    $('#menu').metisMenu();
});
//boxed code
$('.boxed .boxedli a').on('click', function () {
    $('body').addClass('container');
});
//fixed top
$('.sub-menu .fixedtop a').on('click', function () {
    $('.navbar').addClass('navbar-fixed-top');
});
//fixedtop and menu
$('.sub-menu .fixedtop-menu a').on('click', function () {
    $('.sidebar').addClass('affix');
    $('.navbar').addClass('navbar-fixed-top');
    $('.content-header').addClass('padding-top');
});
